        "Tab": "UI_LegendQuestImg_SkirkNew",
        "Icon": "UI_ChapterIcon_SkirkNew",
        "Intro": "별들이 하늘을 수놓고, 세월은 끝없이 흐른다. 머나먼 우주에 수많은 사람들의 기대가 걸려 있다.<br>하지만 꿈이 부딪혀 깨질 때마다 파열음이 울려 퍼진다. 아름다운 밤하늘은 무수히 많은 문명의 잔해이니.<br>행복과 불행이 뒤엉키고, 시간의 단조 끝에 하나가 된다. 역사와 미래가 뒤엉켜 지금 이 순간의 인생이 된 것처럼"
