        "Icon": "UI_ChapterIcon_Mizuki",
        "Intro": "이나즈마의 민간에는 운이 좋으면 선잠에 들었을 때 어떤 동글동글한 귀여운 생명체를 볼 수 있다는 소문이 전해진다. 그럴 때면 하던 일을 잠시 멈추고 서둘러 잠자리에 드는 것이 좋은데, 그 이유는 바쿠라는 이름의 이 요괴가 당신이 잠든 사이에 악몽을 먹어 치워 줄 것이기 때문이다.<br>하지만 오늘날의 이나즈마 사람들은 이런 서비스를 받기 위해 운에만 기대고 있지 않아도 된다. 이나즈마성에 있는 아이사 대중탕에 심리 치료 서비스를 예약하기만 하면 되기 때문이다. 소문에 따르면 그곳의 심리 치료사는 바쿠의 화신인 소녀로, 수많은 손님이 악몽에서 벗어나도록 도왔다고 한다.<br>그러나 한때 잘 나가던 아이사 대중탕은 어쩐 일인지 심각한 경영 위기를 맞은 것처럼 보인다. 그 원인을 알아내기 위해서는 먼저 꿈속에서 한 차례 만남을 가져야 한다…"
