        "Tab": "UI_LegendQuestImg_Clorinde",
        "Icon": "UI_ChapterIcon_Clorinde",
        "Intro": "오페라 하우스의 조명이 꺼지고 무대 위 심판의 막이 내리자… 클로린드는 손에 든 검을 다시 칼집에 꽂았다.<br>대다수의 사람에게 이 폰타인 「최강」의 결투 대리인이 여가 시간을 어떻게 보내는지는 하나의 미스터리였다. 감히 묻는 사람도, 깊게 파고들려는 사람도 없었다…<br>누군가는 어두운 골목에서 그녀의 그림자를 봤다고 했고, 누군가는 숲으로 그림자를 사냥하러 간다고 했다. 또 누군가는 종종 폰타인의 한 「테이블 극단」이라는 클럽을 방문한다고 말했다…<br>과연 이 「최강」의 결투 대리인은, 오늘 어디에 나타날까…"
